#!/usr/bin/env python3
import os
import sys
from trello import TrelloClient

def get_board(client, board_id):
    try:
        board = client.get_board(board_id)
        return board
    except Exception as e:
        sys.stderr.write(f"Error getting board: {e}\n")
        raise

def get_or_create_list(board, list_name):
    try:
        lists = board.list_lists('open')
        for lst in lists:
            if lst.name == list_name:
                return lst
        # if not found, create the list
        new_list = board.add_list(list_name)
        return new_list
    except Exception as e:
        sys.stderr.write(f"Error accessing or creating list '{list_name}': {e}\n")
        raise

def create_card(list_obj, card_name, description, due):
    try:
        card = list_obj.add_card(name=card_name, desc=description, due=due)
        return card
    except Exception as e:
        sys.stderr.write(f"Error creating card '{card_name}': {e}\n")
        raise

def assign_members(card, board, users):
    try:
        board_members = board.all_members()
        assigned = False
        for username in users:
            found = None
            for member in board_members:
                # member.username might exist; if not, compare full name or id as required.
                if hasattr(member, 'username') and member.username.lower() == username.lower():
                    found = member
                    break
            if found:
                try:
                    card.add_member(found)
                    assigned = True
                except Exception as assign_e:
                    sys.stderr.write(f"Error assigning member '{username}' to card: {assign_e}\n")
                    raise
            else:
                sys.stderr.write(f"Member '{username}' not found on board.\n")
                raise Exception(f"Member '{username}' not found on board.")
        return assigned
    except Exception as e:
        sys.stderr.write(f"Error in assign_members: {e}\n")
        raise

def add_checklist_to_card(card, checklist_items):
    try:
        # Use a generic checklist title, e.g., "Checklist"
        card.add_checklist("Checklist", checklist_items)
    except Exception as e:
        sys.stderr.write(f"Error adding checklist to card: {e}\n")
        raise

def main():
    try:
        # Load environment variables
        api_key = os.environ.get("TRELLO_API_KEY")
        api_secret = os.environ.get("TRELLO_API_SECRET")
        token = os.environ.get("TRELLO_API_TOKEN")
        board_id = os.environ.get("TRELLO_BOARD_ID")
        if not all([api_key, api_secret, token, board_id]):
            sys.stderr.write("Missing one or more required environment variables.\n")
            print(0)
            return

        # Initialize Trello client
        client = TrelloClient(api_key=api_key, token=token)

        # Our task info (in a real scenario, this might come from an input or file)
        task_card_name = "Project Kickoff Card"
        task_details = {
            'description': 'Create a new project kickoff card with a checklist of initial tasks and a due date for project planning.',
            'list': 'Project Kickoff',
            'users': ['dgreiver'],
            'due': '2025-03-15T17:00:00',
            'checklist': ['Define project scope', 'Identify team roles', 'Establish milestones']
        }

        # Get board object
        board = get_board(client, board_id)
        # Get or create list
        target_list = get_or_create_list(board, task_details['list'])
        # Create a card in the target list
        card = create_card(target_list, task_card_name, task_details['description'], task_details['due'])
        # Assign users to the card
        assign_members(card, board, task_details['users'])
        # Add checklist to the card
        add_checklist_to_card(card, task_details['checklist'])

        print(1)
    except Exception as e:
        # In case of any exception, error message already written to stderr above.
        print(0)

if __name__ == "__main__":
    main()

import os
import sys
from trello import TrelloClient
from dotenv import load_dotenv

load_dotenv()

def get_trello_client():
    try:
        client = TrelloClient(
            api_key=os.environ.get("TRELLO_API_KEY"),
            api_secret=os.environ.get("TRELLO_API_SECRET"),
            token=os.environ.get("TRELLO_API_TOKEN")
        )
        return client
    except Exception as e:
        sys.stderr.write("Error initializing Trello client: " + str(e))
        return None

def get_board(client):
    try:
        board_id = os.environ.get("TRELLO_BOARD_ID")
        board = client.get_board(board_id)
        return board
    except Exception as e:
        sys.stderr.write("Error retrieving board: " + str(e))
        return None

def get_card_by_identifier(board, identifier, client):
    try:
        # First, try to get the card directly using Trello API Client Functions.
        card = client.get_card(identifier)
        if card:
            return card
    except Exception:
        pass
    try:
        # If direct retrieval fails, search through all cards on the board by name.
        cards = board.all_cards()
        for c in cards:
            if c.name == identifier:
                return c
    except Exception as e:
        sys.stderr.write("Error fetching cards from board: " + str(e))
    return None

def update_card_description(card, new_desc):
    try:
        card.set_description(new_desc)
        return "Task updated successfully."
    except Exception as e:
        err_msg = "Error updating card description: " + str(e)
        sys.stderr.write(err_msg)
        return err_msg

def process_task(task, client, board):
    card = get_card_by_identifier(board, task.get("card_id"), client)
    if not card:
        err_msg = "Card not found with identifier: " + task.get("card_id")
        sys.stderr.write(err_msg)
        return err_msg
    # For this task we update the card description.
    result = update_card_description(card, task.get("new_description"))
    return result

def main():
    try:
        # Task content received for meeting summarization
        task = {
            'description': 'Aggregate all comments from a card and update its description with a summary of the meeting decisions.',
            'card_id': 'Post-Meeting Slack Update',
            'users': ['dgreiver'],
            'comment_summary': 'Consolidated feedback: next steps clarified and action items confirmed.',
            'new_description': 'Updated description with summarized comments from the meeting.'
        }
        client = get_trello_client()
        if not client:
            print(0)
            return
        board = get_board(client)
        if not board:
            print(0)
            return
        result = process_task(task, client, board)
        if "Error" in result or "not found" in result:
            print(0)
        else:
            print(1)
    except Exception as e:
        sys.stderr.write("Unhandled exception: " + str(e))
        print(0)

if __name__ == "__main__":
    main()

import os
from trello import TrelloClient

def duplicate_card_for_subtask(task):
    try:
        api_key = os.environ['TRELLO_API_KEY']
        token = os.environ['TRELLO_API_TOKEN']
        board_id = os.environ['TRELLO_BOARD_ID']
        # Initialize Trello client
        client = TrelloClient(api_key=api_key, token=token)
        board = client.get_board(board_id)
        # Find the source card by matching its name with the provided source_card_id
        source_card = None
        for card in board.all_cards():
            if card.name == task.get('source_card_id'):
                source_card = card
                break
        if source_card is None:
            raise Exception("Source card not found with name: " + task.get('source_card_id', ''))
        # Use the same list as the source card
        source_list = source_card.get_list()
        # Create new card name and description; include link to the original card if available
        new_card_name = "Sub-Task: " + source_card.name
        original_link = getattr(source_card, 'url', 'Link not available')
        new_card_desc = task.get('description', '') + "\n\nOriginal Card: " + original_link
        # Add the new card to the same list
        new_card = source_list.add_card(name=new_card_name, desc=new_card_desc)
        # Assign provided users to the new card
        users = task.get('users', [])
        for username in users:
            try:
                member = client.get_member(username)
                new_card.add_member(member.id)
            except Exception as e:
                # If there's an error adding a member, continue with others
                continue
        # Add dependency comment to link to the larger task if provided
        if 'dependencies' in task:
            try:
                new_card.comment("Dependency: " + task['dependencies'])
            except Exception as e:
                pass
        return True, "Card duplicated successfully."
    except Exception as e:
        return False, "Error duplicating card: " + str(e)

def main():
    try:
        task = {
            "description": "Duplicate the marketing campaign action items card to create a new sub-task, linking it to the original for reference.",
            "source_card_id": "Action: Marketing Campaign Action Items",
            "users": ["dgreiver"],
            "duplicate": True,
            "dependencies": "This sub-task is part of the larger campaign planning effort."
        }
        success, message = duplicate_card_for_subtask(task)
        if success:
            print(1)
        else:
            print(0)
        return message
    except Exception as e:
        print(0)
        return "Error in main: " + str(e)

if __name__ == "__main__":
    main()

import os
from trello import TrelloClient

def load_environment():
    try:
        api_key = os.getenv("TRELLO_API_KEY")
        api_token = os.getenv("TRELLO_API_TOKEN")
        board_id = os.getenv("TRELLO_BOARD_ID")
        if not (api_key and api_token and board_id):
            raise Exception("Missing one or more environment variables: TRELLO_API_KEY, TRELLO_API_TOKEN, or TRELLO_BOARD_ID")
        return api_key, api_token, board_id
    except Exception as e:
        raise Exception("Error loading environment variables: " + str(e))

def get_trello_client(api_key, api_token):
    try:
        client = TrelloClient(api_key=api_key, token=api_token)
        return client
    except Exception as e:
        raise Exception("Error initializing Trello client: " + str(e))

def get_board(client, board_id):
    try:
        board = client.get_board(board_id)
        return board
    except Exception as e:
        raise Exception("Error retrieving board: " + str(e))

def get_card_by_name(board, card_name):
    try:
        cards = board.all_cards()
        for card in cards:
            if card.name == card_name:
                return card
        raise Exception("Card with name '{}' not found on board.".format(card_name))
    except Exception as e:
        raise Exception("Error retrieving card: " + str(e))

def update_rollback_workflow(card, task):
    try:
        # Add provided users to the card
        users = task.get('users', [])
        for user in users:
            try:
                card.add_member(user)
            except Exception as e:
                # If unable to add a member, add a comment noting the failure
                card.comment("Warning: Failed to add member '{}'. Detail: {}".format(user, str(e)))
        # If rollback procedure is enabled, add a comment with rollback instructions
        rollback = task.get('rollback_procedure', {})
        if rollback.get('enabled'):
            script = rollback.get('script', 'N/A')
            condition = rollback.get('condition', 'N/A')
            rollback_message = "Rollback Workflow Triggered:\nIf tests fail, please execute '{}' ({})".format(script, condition)
            card.comment(rollback_message)
        # Add test suite info as a comment for reference
        test_suite = task.get('test_suite', {})
        if test_suite:
            ts_message = "Note: Test Suite '{}' is configured to trigger '{}'.".format(test_suite.get('id', 'N/A'), test_suite.get('trigger', 'N/A'))
            card.comment(ts_message)
        return "Task updated successfully"
    except Exception as e:
        raise Exception("Error updating rollback workflow on card: " + str(e))

def process_task(task):
    try:
        api_key, api_token, board_id = load_environment()
        client = get_trello_client(api_key, api_token)
        board = get_board(client, board_id)
        card = get_card_by_name(board, task.get('card_id'))
        result = update_rollback_workflow(card, task)
        return result
    except Exception as e:
        return str(e)

def main():
    try:
        task = {
            "description": "On the Prioritize Critical Bug Fix card, trigger a rollback procedure if automated tests fail as per meeting instructions.",
            "card_id": "Prioritize Critical Bug Fix",
            "users": ["dgreiver"],
            "test_suite": {"id": "TEST_CRITICAL_BUG", "trigger": "on_failure"},
            "rollback_procedure": {"enabled": True, "script": "rollback_script.sh", "condition": "if tests fail"}
        }
        result = process_task(task)
        if "successfully" in result:
            print("1")
        else:
            print("0")
    except Exception:
        print("0")

if __name__ == '__main__':
    main()
